package org.apache.commons.text;

import java.util.HashSet;
import java.util.Set;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;

public class RandomStringGeneratorAccumulationTest {

    @ParameterizedTest
    @ValueSource(booleans = {true, false})
    public void testCharacterAccumulation(boolean accumulate) {
        final char[] referenceCharSet = {'a', 'b', 'c', 'd', 'e'};

        final RandomStringGenerator.Builder builder = RandomStringGenerator.builder()
                .setAccumulate(accumulate)
                .selectFrom(referenceCharSet)
                .selectFrom(new char[]{'a', 'b', 'c', 'd'})
                .selectFrom(new char[]{'a', 'b', 'c'})
                .selectFrom(new char[]{'a', 'b'})
                .selectFrom(new char[0]);

        final RandomStringGenerator generator = builder.build();

        final Set<Character> referenceChars = new HashSet<>();
        for (char c : referenceCharSet) {
            referenceChars.add(c);
        }

        if (accumulate) {
            final String generatedText = generator.generate(10);
            for (final char c : generatedText.toCharArray()) {
                Assertions.assertTrue(referenceChars.contains(c),
                        "Generated character '" + c + "' should be in the reference set.");
            }
        } else {
            final String generatedText = generator.generate(10);
            for (final char c : generatedText.toCharArray()) {
                Assertions.assertFalse(referenceChars.contains(c),
                        "Generated character '" + c + "' should NOT be in the reference set.");
            }
        }
    }
}

package org.apache.commons.text;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;

public class RandomStringGeneratorTest1 {

    @ParameterizedTest
    @ValueSource(booleans = {true, false})
    public void testSelectFrom(boolean accumulate) {
        String reference_string = "abcde";

        RandomStringGenerator.Builder builder = RandomStringGenerator.builder()
                .setAccumulate(accumulate)
                .selectFrom("abcde".toCharArray())
                .selectFrom("abcd".toCharArray())
                .selectFrom("abc".toCharArray())
                .selectFrom("ab".toCharArray())
                .selectFrom(null)
                .selectFrom(new char[0]);

        if (!accumulate) {
            builder.selectFrom("xyz".toCharArray());
        }

        RandomStringGenerator generator = builder.build();
        String generated_string = generator.generate(10);

        if (accumulate) {
            for (char c : generated_string.toCharArray()) {
                Assertions.assertTrue(reference_string.indexOf(c) != -1, "Character not in reference string: " + c);
            }
        } else {
            for (char c : generated_string.toCharArray()) {
                Assertions.assertFalse(reference_string.indexOf(c) != -1, "Character was found in reference string: " + c);
            }
        }
    }
}

