public class StringSubstitutorCircularRefTest {

    @Test
    void testSubstitutionWithCircularReference() {
        // Define a configuration with a variable 'name' that references itself
        Map<String, String> circularReferenceConfig = new HashMap<>();
        circularReferenceConfig.put("name", "<name>");

        // Prepare an input message
        String inputMessage = "Hello <name>";

        // Attempt to substitute and verify an IllegalStateException is thrown
        assertThrows(IllegalStateException.class, () -> {
            StringSubstitutor.replace(inputMessage, circularReferenceConfig, "<", ">");
        });
    }
