package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertThrows;

public class TextStringBuilderInsertTest {

    @Test
    public void testInsert() {
        // Step 0: Instantiate a new Text String Builder
        TextStringBuilder textStringBuilder = new TextStringBuilder();

        // Step 1 & 2: Get the string representation and verify it is empty
        String stringRepresentation = textStringBuilder.toString();
        assertEquals(
            "", stringRepresentation);

        // Step 3 & 4: Insert a string literal and confirm content
        textStringBuilder.insert(0, "some string");
        assertEquals("some string", textStringBuilder.toString());

        // Step 5-8: Verify index out of bounds for string insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, "invalid"));
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(99, "invalid"));

        // Step 9 & 10: Insert a boolean and validate
        textStringBuilder.insert(textStringBuilder.size(), true);
        assertEquals("some stringtrue", textStringBuilder.toString());

        // Step 11-14: Verify index out of bounds for boolean insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, false));
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(99, false));

        // Step 15 & 16: Insert a character and confirm
        textStringBuilder.insert(textStringBuilder.size(), 'c');
        assertEquals("some stringtruec", textStringBuilder.toString());

        // Step 17-20: Verify index out of bounds for char insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, 'x'));
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(99, 'x'));

        // Step 21-23: Insert a character array and verify
        char[] charArray = "array".toCharArray();
        textStringBuilder.insert(textStringBuilder.size(), charArray);
        assertEquals("some stringtruecarray", textStringBuilder.toString());

        // Step 24-28: Verify index out of bounds for char array insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, charArray));
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(99, charArray));

        // Step 29-31: Insert a subset of a character array and verify
        textStringBuilder.insert(textStringBuilder.size(), charArray, 1, 2);
        assertEquals("some stringtruecarrayrr", textStringBuilder.toString());

        // Step 32-34: Verify index out of bounds for char array subset insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, charArray, 0, 1));

        // Step 35 & 36: Insert a double and validate
        textStringBuilder.insert(textStringBuilder.size(), 3.14);
        assertEquals("some stringtruecarrayrr3.14", textStringBuilder.toString());

        // Step 37 & 38: Verify index out of bounds for double insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, 1.0));

        // Step 39 & 40: Insert a float and validate
        textStringBuilder.insert(textStringBuilder.size(), 1.23f);
        assertEquals("some stringtruecarrayrr3.141.23", textStringBuilder.toString());

        // Step 41 & 42: Verify index out of bounds for float insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, 1.0f));

        // Step 43 & 44: Insert an integer and validate
        textStringBuilder.insert(textStringBuilder.size(), 123);
        assertEquals("some stringtruecarrayrr3.141.23123", textStringBuilder.toString());

        // Step 45 & 46: Verify index out of bounds for int insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, 0));

        // Step 47 & 48: Insert a long and validate
        textStringBuilder.insert(textStringBuilder.size(), 9876543210L);
        assertEquals("some stringtruecarrayrr3.141.231239876543210", textStringBuilder.toString());

        // Step 49 & 50: Verify index out of bounds for long insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, 0L));

        // Step 51-53: Insert an object and verify
        Object objectReference = new Object() {
            @Override
            public String toString() {
                return "object";
            }
        };
        textStringBuilder.insert(textStringBuilder.size(), objectReference);
        assertEquals("some stringtruecarrayrr3.141.231239876543210object", textStringBuilder.toString());

        // Step 54-58: Verify index out of bounds for object insertion
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(-1, objectReference));
        assertThrows(IndexOutOfBoundsException.class, () -> textStringBuilder.insert(99, objectReference));
    }
}

package org.apache.commons.text;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertThrows;

import org.junit.jupiter.api.Test;

public class TextStringBuilderInsertTest {

    private static final String SEP = System.lineSeparator();
    private static final Object FOO = new Object() {
        @Override
        public String toString() {
            return "foo";
        }
    };

    @Test
    public void testInsert() {
        final TextStringBuilder sb = new TextStringBuilder();
        assertEquals("", sb.toString());

        sb.insert(0, "Hello");
        assertEquals("Hello", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-1, "World"));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(6, "World"));

        sb.insert(5, true);
        assertEquals("Hellotrue", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(10, false));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-20, false));

        sb.insert(9, 'A');
        assertEquals("HellotrueA", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(11, 'B'));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-2, 'B'));

        sb.insert(10, new char[]{'B', 'C'});
        assertEquals("HellotrueABC", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(13, new char[]{'D', 'E'}));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-1, new char[]{'D', 'E'}));

        sb.insert(12, new char[]{'D', 'E', 'F'}, 1, 1);
        assertEquals("HellotrueABCE", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(14, new char[]{'G', 'H', 'I'}, 1, 2));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-1, new char[]{'G', 'H', 'I'}, 1, 1));

        sb.insert(13, 1.2d);
        assertEquals("HellotrueABCE1.2", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(17, 1.3d));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-1, 1.3d));

        sb.insert(16, 1.0f);
        assertEquals("HellotrueABCE1.21.0", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(20, 1.3f));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-3, 1.3f));

        sb.insert(19, 23);
        assertEquals("HellotrueABCE1.21.023", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(22, 20));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-5, -5));

        sb.insert(21, 99L);
        assertEquals("HellotrueABCE1.21.02399", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(24, 22L));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-1, -1L));

        sb.insert(23, FOO);
        assertEquals("HellotrueABCE1.21.02399foo", sb.toString());

        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(27, FOO));
        assertThrows(IndexOutOfBoundsException.class, () -> sb.insert(-3, FOO));
    }
}

