public class XmlStringLookupWithDtdTest {

    @TempDir
    Path tempDir;

    @Test
    public void testXmlLookupWithDtd() throws Exception {
        // Setup: Create temporary DTD and XML files for the test
        File dtdFile = new File(tempDir.toFile(), "test.dtd");
        try (FileWriter writer = new FileWriter(dtdFile)) {
            writer.write("<!ENTITY replacement \"Hello World!\">");
        }

        File xmlFile = new File(tempDir.toFile(), "test.xml");
        try (FileWriter writer = new FileWriter(xmlFile)) {
            writer.write("<?xml version=\"1.0\"?>\n");
            writer.write("<!DOCTYPE doc SYSTEM \"" + dtdFile.toURI() + "\">\n");
            writer.write("<doc>&replacement;</doc>");
        }

        // Step 0: Set the system security property to permit file-based external DTD access
        final String key = "javax.xml.XMLConstants.ACCESS_EXTERNAL_DTD";
        final String originalValue = System.getProperty(key);
        System.setProperty(key, "file");

        try {
            // Step 1: Initialize an interpolation service with external DTD access
            final StringLookup masterLookup = StringLookupFactory.INSTANCE.interpolatorStringLookup();
            final Map<String, StringLookup> lookups = ((InterpolatorStringLookup) masterLookup).getStringLookupMap();

            final Map<String, Boolean> features = new HashMap<>();
            features.put("http://apache.org/xml/features/disallow-doctype-decl", false);
            features.put("http://xml.org/sax/features/external-general-entities", true);
            final StringLookup xmlStringLookup = StringLookupFactory.INSTANCE.xmlStringLookup(features);

            lookups.put(StringLookupFactory.KEY_XML, xmlStringLookup);

            final StringSubstitutor interpolation_service = new StringSubstitutor(masterLookup);

            // Step 2: Prepare a substitution request
            final String substitution_request = String.format("${xml:%s/doc}", xmlFile.getAbsolutePath());
            final String expected_content = "Hello World!";

            // Step 3: Execute the interpolation operation
            final String interpolation_output = interpolation_service.replace(substitution_request);

            // Step 4: Remove extraneous whitespace
            final String trimmed_output = interpolation_output.trim();

            // Step 5: Verify the trimmed output
            Assertions.assertEquals(expected_content, trimmed_output);

        } finally {
            // Step 6: Reset the system security property
            if (originalValue != null) {
                System.setProperty(key, originalValue);
            } else {
                System.clearProperty(key);
            }
        }
    }
}

