class StringSubstitutorSecurityTest {

  @Test
  void testFileLookupSecurity() throws Exception {
    // Step 0: Create a test document file with known content
    final Path external_document_path = Files.createTempFile("test", ".txt");
    final String file_content = "secret content";
    Files.write(external_document_path, file_content.getBytes());

    // Set a system property for the path. The interpolator will use this.
    System.setProperty("external_document_path", external_document_path.toAbsolutePath().toString());

    try {
      // --- Secure by default ---

      // Step 1: Instantiate the default, secure text interpolation system
      final StringSubstitutor interpolation_system = new StringSubstitutor();

      // Step 3: Define a malicious variable expression using the 'sys' prefix for the nested variable
      final String malicious_variable_expression = "${file:UTF-8:${sys:external_document_path}}";

      // Step 4: Attempt to process text. The default substitutor does not use the interpolator lookup,
      // so it will not resolve 'file' or 'sys' prefixes.
      final String processing_result = interpolation_system.replace(malicious_variable_expression);

      // Step 5: Verify that the unresolved variable is returned as-is
      assertEquals(malicious_variable_expression, processing_result);

      // --- Insecure when configured ---

      // Step 6: Create a new interpolator that allows file lookups
      final StringSubstitutor insecure_interpolation_system = StringSubstitutor.createInterpolator();

      // Step 7: Enable substitution in variables to allow the nested ${sys:...} to be resolved
      insecure_interpolation_system.setEnableSubstitutionInVariables(true);

      // Step 8: Process text. The interpolator will resolve ${sys:...}, then ${file:...}
      final String insecure_processing_result =
          insecure_interpolation_system.replace(malicious_variable_expression);

      // Step 9: Verify the interpolation operation completes successfully
      assertNotNull(insecure_processing_result);

      // Step 10: Assert the resulting text contains the content from the external document
      assertEquals(file_content, insecure_processing_result);

    } finally {
      // Step 11: Delete the test document file and clean up system property
      Files.deleteIfExists(external_document_path);
      System.clearProperty("external_document_path");
    }
  }
}

